    "2016-09-03T03:41:38.192318",nt"name": "elevationdem-dem1p6m2008",nt"isopen":
    false,nt"url": null,nt"notes": "This metadata applies to the following
    collection area(s): Missisquoi Lower 2008 1.6m and Digital Elevation Model (DEM)
    datasets of various "hydro-treatments": *DEM, *DEMHF & *DEMHE. This metadata complies
    with the VT Geodata Portal format and applies to thematic layers with the same resolution
    (RESCLASS), e.g., 0p7m, 1m etc., and may include multiple data "collection" efforts.
    For the original vendor metadata containing specific details on each collections
    "point cloud" such as flight dates, nominal pulse spacing and RMSEz etc., see
    the "All Available LiDAR" Product page: (http://vcgi.vermont.gov/warehouse/products/ALL-LDR_MIX_LIDAR_STATE_ALL).
    Available DEMs vary by collection and can include the following 'hydro treatment'
    DEMs: 1) Elevation*_DEM_*: ("pure" Bare Earth) - no treatments, i.e., a bare ground
    surface without objects like vegetation and buildings; 2) Elevation*_DEMHF_*: (DEM
    Hydro-Flattened)- Cartographic/Aesthetic enhancement of (topographic) surface by
    removal of LiDAR artifacts in water. Constant elevation for waterbodies and suitable
    for contouring. Building voids remain due to cost; and 3) Elevation*_DEMHE_*: (DEM
    Hydro-Enforced): A (hydrologic) surface with drain connectivity used by engineers
    in Hydraulic and Hydrologic (H&H) modeling. NOT for traditional mapping (contours,
    etc.). Like DEM_HF but added Single Line Breaklines: Pipelines, Culverts, Underground
    Streams, etc. For an overview of the "Vermont LiDAR Initiative" please see "http://vcgi.vermont.gov/lidar".",nt"license_title":
